import React from "react";
import "./popup.css";

const Popup = ({ closeoption, checkcall, message }) => {

  return (
    <div className="card_layout">
      <p>{message}</p>
      <div></div><button onClick={closeoption}>Close</button>
      <button onClick={checkcall}>Continue</button>

    </div>
  );
};

export default Popup;
